void loop() {
  // prompt the user to enter text
  Serial.println("Enter text to convert to Morse code:");
  String input;
  while (Serial.available() == 0) {} // wait for input
  while (Serial.available() > 0) {
    char c = Serial.read();
    if (c == '\n') break;
    input += c;
  }

  // convert the input text to Morse code
  for (int i = 0; i < input.length(); i++) {
    char c = input.charAt(i);
    if (c >= 'A' && c <= 'Z') c = c - 'A' + 'a';
    if (c < 'a' || c > 'z') continue;
    int index = c - 'a';
    String morse = morseCode[index];
    for (int j = 0; j < morse.length(); j++) {
      char symbol = morse.charAt(j);
      if (symbol == '.') {
        tone(9, 1000, dotDuration);
        delay(dotDuration);
      } else if (symbol == '-') {
        tone(9, 1000, dashDuration);
        delay(dashDuration);
      }
      if (j < morse.length() - 1) {
        delay(dotDuration);
      }
    }
    if (i < input.length() - 1) {
      delay(spaceDuration);
    } else {
      delay(letterSpaceDuration);
    }
  }
}

void tone(int pin, int frequency, int duration) {
  digitalWrite(pin, HIGH);
  long start = millis();
  long elapsed = 0;
  while (elapsed < duration) {
    elapsed = millis() - start;
    int delayAmount = 1000 / frequency - elapsed % 1000;
    if (delayAmount < 0) delayAmount = 0;
    delay(delayAmount);
  }
  digitalWrite(pin, LOW);
}
